/// Convert copy-on-write string to `Value::String`.
///
/// # Examples
///
/// ```
/// use serde_json::Value;
/// use std::borrow::Cow;
///
/// let s: Cow<str> = Cow::Borrowed("lorem");
/// let x: Value = s.into();
/// ```
///
/// ```
/// use serde_json::Value;
/// use std::borrow::Cow;
///
/// let s: Cow<str> = Cow::Owned("lorem".to_owned());
/// let x: Value = s.into();
/// ```
